package model.domain;import javax.persistence.*;@Entity@Table(name = "status_task", schema = "", catalog = "raindrop")public class StatusTask extends BaseEntity {    private long idStatusTask;    private String nume;    private int ordine;    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "id_status_task")    public long getIdStatusTask() {        return idStatusTask;    }    public void setIdStatusTask(long idStatusTask) {        this.idStatusTask = idStatusTask;    }    @Basic    @Column(name = "nume", nullable = false, insertable = true, updatable = true)    public String getNume() {        return nume;    }    public void setNume(String nume) {        this.nume = nume;    }    @Basic    @Column(name = "ordine", nullable = false, insertable = true, updatable = true)    public int getOrdine() {        return ordine;    }    public void setOrdine(int ordine) {        this.ordine = ordine;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof StatusTask)) return false;        StatusTask that = (StatusTask) o;        if (idStatusTask != that.idStatusTask) return false;        if (ordine != that.ordine) return false;        return !(nume != null ? !nume.equals(that.nume) : that.nume != null);    }    @Override    public int hashCode() {        int result = (int) (idStatusTask ^ (idStatusTask >>> 32));        result = 31 * result + (nume != null ? nume.hashCode() : 0);        result = 31 * result + ordine;        return result;    }}